import './textbox.css';
const Textbox=(props)=>{
    return(
        <div>
            <label htmlFor={props.name}>{props.label}</label><br/>
            <input type="text" id={props.name} name={props.name} value={props.name} onChange={props.inputDataChange}/>
        </div>

    )
}
